function splitCountryNameWithSpace(countryName) {
  return LogicUtils.camelCaseToTitle(getCountryNameFromVarient(countryName));
}

function getCountryOption(countryType) {
  var countryName = splitCountryNameWithSpace(countryType);
  var countryCode = getCountryCodeStringFromVarient(
    getCountryCodeFromCountry(countryType),
  );
  return {
    label: countryName,
    value: countryCode,
  };
}

